import React from 'react';
import { Route } from 'react-router-dom';
import Login from './pages/Login';
import Wallet from './pages/Wallet';

function App() {
  return (
    <div>
      <Route exact component={ Login } path="/" />
      <Route exact component={ Wallet } path="/carteira" />
    </div>
  );
}

export default App;
